function SortFileID()
    local tbl = {};
    local tinsert = table.insert;
    local ids = {};
    for creatureID, fileID in pairs(creatureIDxFileID) do
        tinsert(ids, creatureID);
    end
    table.sort(ids);
    local id;
    for i = 1, #ids do
        id = ids[i];
        tbl[id] = creatureIDxFileID[id];
    end
    CreatureIDxModelFileID = tbl;
end